const Country = ({ image, name, id, info, glass }) => {
  return (
    <article className="country-card">
      <div className="img-container">
        <img src={image} alt={name} />
      </div>
      <div className="country-data">
        <h3>{name}</h3>
        <h4>{glass}</h4>
        <p>{info}</p>
      </div>
    </article>
  );
};
